function MonthArrow(props) {

    const { year, month, number } = props.day;

    // Calculate the new month value and handle the edge case for December
    const newMonth = month === 11 ? 0 : month + 1;
    const newYear = month === 11 ? year + 1 : year;

    // Construct the new Date object with adjusted month and year
    const newDate = new Date(newYear, newMonth, number);

    return (
        <div onClick={() => props.changeCurrentDay(newDate)}>
            <p>CLICK ME</p>
        </div>
    );
}

export default MonthArrow;
